import NoteList from "./Components/NoteList";
import Account from "./Components/Account";

import './App.css';

function App() {



  return (
    <div className="App">

      {/* account management */}
      <Account />

      {/* sidebar */}
      <div id="sidebar">
        <Sidebar />
      </div>

      {/* main content */}
      <div id="main">
        <NoteList />
      </div>

    </div>
  );
}

export default App;
